import React, { Component } from 'react'

export class Good extends Component {
  render() {
    return (
      <div className='good'>
        <img src={'./img/'+ this.props.Good.img} />
        <h1>{this.props.Good.title}</h1>
        {this.props.Good.desc}
        {this.props.Good.price}
        <div className='addcorz'>+</div>
    </div>
    )
  }
}

export default Good
